VALUES ('8017596065872', 'Toffee al latte', 'Teffee al latte Dolciando è la marca esperta det dolci, prodotti pensati e realizzati rigorosamerte con ingredienti selezionati. Dolciando ti offre una vasta scelta di caramelle, ideali per i tuoi piccoli momenti di dolcezza. CARAMELLE MORBIDE AL LATTE Ingredienti: sciroppo di glucosio, zucchero, LATTE parzlalmente scremato concentrato zuccherato (17%), grassi vegetali (cocco e burro di cacao in proporzione variabile), addensante: gomma arabica, sale, aromi, emulsionante esteri di saccarosio degli acidi grassi. Può contenere tracce di UOVA. WEICHE MILCHBONBONS Zutaten: Glucosesirup, Zucker, teilentrahmtes gezuckertes MILCHkonzentrat (17%), Pflanzenfette (Kokosfett und Butter in veränderlichen Gewichtsanteilen), Verdickungsmittel: Gummi arabicum, Salz, Aromen, Emulgator: Saccharoseester von Speisefettsäuren. Kann Spuren von EIERN enthalten. 1 MEHKI MLECNI BONBONI Sestavine: glukozni sirup, sladkor, sladkano kondenzirano delno posneto MLEKO (17% ), rastlinske maščobe (kokos In kakavovo maslo v spremenljivih deležih), sredstvo za zgostitev: gumi arabikum, jedilna sol, arome, emulgatorji: saharozni estri maščobnih klslin. Lahko vsebuje sledi JAJC $3 a W A Wa', 'https://static.openfoodfacts.org/images/products/801/759/606/5872/front_it.17.400.jpg', '', '', '', '', '', '', '', '', '', '1');

