VALUES ('8018211201330', 'Vellutata di cannellini e barbabietola rossa', 'Preparato per vellutata di CANNELLINI E BARBABIETOLA ROSSA Da più di 250 anni selezioniamo i grani migliori. L\'impegno e l\'esperienza di Molino Rossetto nascono dalla passione di garantirti ogni giorno sapori veri ed unici. Mugnai secondo natura, dal 1760. Ingredienti: farina di fagioli cannellini* 90% , barbabietola rossa in polvere* 5%, sale, rosmarino essiccato*, insaporitore vegetale (farina di riso*, carota in polvere*, porro in polvere*, cipolla in polvere*, pomodoro in polvere*, prezzemolo essiccato*, curcuma in polvere*, olio di girasole*, erba cipollina essiccata*, alloro in polvere*) Biologico Prodotto in uno stabilimento in cui si utilizza anche soia. Tempo di preparazione: 5 minuti. Preparazione: versate in una pentola capiente 600 ml di acqua fredda. Aggiungete a pioggia il contenuto della confezione, evitando la formazione di grumi. Mescolate il tutto con l\'aiuto di una frusta o di una forchetta e portate a bollore. Cuocete per 2 minuti. Prima di servire, aggiungete a piacere olio extra vergine d\'oliva, sale e pepe. *Per una vellutata dalla consistenza più fluida aggiungete acqua.', 'https://static.openfoodfacts.org/images/products/801/821/120/1330/front_it.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

