VALUES ('8018370003103', 'Cristalli di Sale al Pomodoro', 'Crystals salt (Cyprus), tomato 3%. The crystals of salt are picked up on the coast of Cyprus.They are lighter than the ordinary sea sait. They contain less chtoride of sodium than ordinary and they contain a lot of minerais such as magnesium. For their particular typesetting, the crystals of salt are healthy and tasty. It is possible to use this salt raw too because the crystals easily dissolve. PSONETTO/ consumare enËo il / Best before date: 28%2/2020 conservare in tuogo fresco e asciutb / KEP in dried place confezionab atrnosfera protetüva / Packed in a probcüve abnosplEte va)?i nutriiuuli per 100gr / Nutritmal value per 100gr I I I I I I. I I. I I I I I I I II Il I I II Il L O kJ (', 'https://static.openfoodfacts.org/images/products/801/837/000/3103/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '0', '95', '37.4015748031496', '', '0');

