INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8018370005060', 'Risotto al tartufo estivo', 'Riz Carnaroli (Italiè) 95%, cèpes (Boletus Edulis), truffe de la St-Jean (Tuber astivum) 1 persil, cebettes, ail, arôme truffe 0,5%, PREPARAZIONE: Versare il contenuto della busta in una pentola larga e bassa con qualche cucchiaio di olio extra vergine di Oliva (ca. 5 cucchiai da tavola) e del vino bianco. Fare rosolare qualche minuto mescolando. Aggiungere del brodo caldo preparato a parte. la cottura mescolare di tanto in tanto e, se ej necessario, aggiungere altro brodo o acqua calda. Salare. Condire con burro. PRÉPARATION\'. Faire revenir le riz dans une casserole avec env. 5 cuillères d\'huile d\'olive et un demi verre de vin blanc sec. Mouiller peu à peu avec 1 litre de bouillon. Laisser cuire doucement al dente avant de saler et d\'ajouter du beurre. distribuito da: / Distribué part G P W SARL 70 Bd Notre Dame - 13006 Marseille - 0033 4 54 28', 'https://static.openfoodfacts.org/images/products/801/837/000/5060/front_fr.4.400.jpg', '0.5', '0.1', '90', '0.02', '2.8', '8.2', '0.002', '0.00078740157480315', '', '1');

